description:
Time is running out for London's Infamous Crime Lord Ronson. In this twisted tale of revenge, rivalry and deceit, who can be trusted? The Informers are everywhere. Keeping twelve hot girls in-check proves to be an impossible task as one by one they turn on Ronson's Firm. We plot the sexual favours, wild orgies and kinky liaisons and get to experience, first hand London's seedy under-world. In this high-paced cinematic production Anjali Kara delivers her biggest Adult feature film to date for The Daring Media Group.

